import React from 'react';

import Select from 'react-select';


export default class Filters extends React.Component {
    constructor(props) {
        super(props);

        this.callback = props.callback;
        this.data     = props.data;
        this.filters  = props.filters;

        this.state = {
            option: null
        };

        this.options = [
            { value: 'blues', label: 'Blues' },
            { value: 'rock', label: 'Rock' },
            { value: 'jazz', label: 'Jazz' },
            { value: 'orchestra', label: 'Orchestra' } 
        ];
    }

    render() {
        return (
            <>
                <div className="cs-filters-wrapper">

                    <label className="cs-filters-label" htmlFor="cs-filters-instructors">Instructors:</label>

                    <Select
                        className="cs-filters-filter"
                        id="cs-filters-instructors"
                        isMulti={true}
                        options={this.options}
                    />

                    <button className="cs-filters-apply" onClick={() => this.callback(this.state.filters)}>Apply</button>
                </div>
            </>
        );
    }
}
